import React from 'react';
import HeroeList from "../heroes/HeroeList";

const MarvelPage = () => {
    return (
        <div>
            <h1 className="text-success mt-5 text-center">Marvel</h1>

            <HeroeList publisher='Marvel Comics' />
        </div>
    );
};

export default MarvelPage;
